pragma solidity ^0.8.0;
// import "VoterLibrary.sol";


library proposalLibrary{

    struct proposal{
        // uint256 proposalId;
        address creator;
        uint8 status;
        string disc;
        // address[] voters;
        uint256 startTime;
        uint256 expirationTime;
        uint16 numOfOptions;
        mapping(address => bool) voters;
        // mapping(address => voter) voterInfo;
        
        // create proposal props
        mapping(string => bool) cand;
        mapping(uint256 => string) candHash;

        // respose proposal props
        mapping(uint => string) result;
        mapping(string => uint) votes;
    }
    // create proposal 
     function createProposal(proposal storage self, uint8 _status, address[] memory _voters, address _creator,
      uint256 _startTime, uint256 _expirationTime, string memory _disc, string[] calldata _cand) internal returns(bool){
                                self.creator = _creator;
                                self.status = _status;
                                self.disc = _disc;
                                self.startTime = _startTime;
                                self.expirationTime = _expirationTime;
                                self.numOfOptions = uint16(_cand.length);
                                for(uint256 i=0;i<_cand.length;i++){
                                    self.cand[_cand[i]] = true;
                                    self.candHash[i+1] =  _cand[i];
                                }
                                for(uint256 i=0;i<_voters.length;i++){
                                    self.voters[_voters[i]] = true;
                                }

                                return true;

                            }
    // take response 
    function responseProposal(proposal storage self, address voter, string memory hash, uint v) internal returns(bool){
        require(self.status == 1, "Proposal: inactive");
        if(block.timestamp > self.expirationTime){
            // answer || result aayega
            self.status = 2;
            uint largestCount = self.votes[self.candHash[1]];
            uint winnerCount = 1;
            self.result[1] = self.candHash[1];
            // this for loop is used to find the winner count
            for(uint16 i = 2; i <= self.numOfOptions; i++){
                if(self.votes[self.candHash[i]] > largestCount){
                    largestCount = self.votes[self.candHash[i]];
                    winnerCount = 1;
                    self.result[1] = self.candHash[i];
                }else if(self.votes[self.candHash[i]] == largestCount){
                    winnerCount ++;
                    self.result[ winnerCount] = self.candHash[i];
                }
            }
            return false;
        }
        // if active 
        require(self.voters[voter], "Not a valid voter for this proposal");
        require(self.cand[hash], "Proposal: invalid candidate");
        self.votes[hash] +=v;
        return true;
    }

}

